import React from 'react';
import './Works.css';
import Narasimhadesktop from "../../assets/images/Narasimha-desktop.png"
import Narasimhamobile from "../../assets/images/Narasimha-mobile.png"

function Works() {
  return (
    <div className="work-container ">
      <h2 className='companyname'>Narasimha Enterprises Hospitality</h2>
      <p>A comprehensive hospitality management website</p>
      <div className='Narasimha-project'>
      <img className='desktop' src={Narasimhadesktop} alt="Narasimha Enterprises Hospitality" />
      <img src={Narasimhamobile} alt="Narasimha Enterprises Hospitality" />
      </div>


    </div>
  );
}

export default Works;
